import React, { useState, useEffect}from "react";
import './navigationBar.css';

function NavigationBar() {

  const [circles, setCircles] = useState([]);

  const handleClick = (e) => {
    const newCircle = {
      x: e.clientX - 25,
      y: e.clientY - 25,
      id: new Date().getTime(),
    };

  }

  return (
    <div>
        <div className="NavBar">
            <p>Home</p>
            <p>Education</p>
            <p>Projects</p>
            <p>Skills</p>
            <p>Contact</p>
        </div>
    </div>
  );
}

export default NavigationBar;
